import { createApp } from 'vue'
import App from './App'


createApp(App).mount('#app')

function onDragStart(event) {
    event
      .dataTransfer
      .setData('text/plain', event.target.id);

    event
      .currentTarget
      .style
      .backgroundColor = 'yellow';
  }
